import React, {Component} from 'react';

class AddUser extends Component {
    render() {
        return (
            <div className="card">
                <h4 className="card-header"> Add New USer</h4>
                <div className="card-body">
                    <form action="">
                        <div className="form-group">
                            <label htmlFor="">Name</label>
                            <input type="text"/>
                        </div>
                    </form>
                </div>
            </div>
        );
    }
}

export default AddUser;
